import { Component } from "react"
import "./style.css"

class NavigationBar extends Component {
    
    state = {
        current: [
            {
                name: "Home",
                isActive: this.props.current === "Home",
                path: "/"
            },
            {
                name: "Other",
                isActive: this.props.current === "Other",
                path: "/other"
            }
        ]
    }

    render() {
        return (
            <ul className="navigation-bar">
                {
                    this.state.current.reverse().map(({name, isActive, path}) => {
                        return (
                            <li className={isActive ? "active" : ""}>
                                <a href={path}>
                                    {name}
                                </a>
                            </li>
                        )
                    })
                }
            </ul>
        )
    }

}

export default NavigationBar;
